import { Container, Stack } from "@mui/material";
import { motion } from "framer-motion";

const Header = ({}) => {
  return (
    <div>
      <Container maxWidth={"lg"}>
        <Stack spacing={"4"} direction={"row"} sx={{ direction:{ xs: "row", sm:"coloum" }}} display={"flex"} style={{ backgroundColor:"black" }} >
          <Stack>
            <h1 className="text-white">hello</h1>
          </Stack>
          <Stack>
            <h1 className="text-white">hello hii </h1></Stack>
        </Stack>
      </Container>
    </div>
  );
};

export default Header;
